import classes from './Home.module.css';
import React, { useState, useEffect } from 'react';
import axios from 'axios';
import { connect } from 'react-redux';
import homeImg from '../../assets/produceImg.jpeg';
import HomeItem from '../../components/UI/HomeItem/HomeItem';

class Home extends React.Component {

    /* useEffect(() => {
        axios.get('http://localhost:3005/products')
        .then(response => {
            console.log(response);
        })
        .catch(err => console.log(err))
    }, []) */
    render() {
        return (
            <div className={classes.Home}>
                <div>
                    <img src={homeImg} width={600} height={400}/>
                </div>
                <p>Fresh Produce, Bakery Goods, and Frozen Goods</p>
                <p>Get Started Below</p>
                <div className={classes.HomeItemContainer}>
                    <HomeItem type="Fruit" click={this.props.history.push('/Fruit')}/>
                    <HomeItem type="Vegetables" click={this.props.history.push('/Vegetables')}/>
                    <HomeItem type="Bakery" click={this.props.history.push('/Bakery')}/>
                    <HomeItem type="Frozen" click={this.props.history.push('/Frozen')}/>
                </div>
            </div>
        )
    }


}

const mapStateToProps = state => {
    return {
        productsCol: state.products
    }
}

/* const mapDispatchToProps = dispatch => {

} */

export default connect(mapStateToProps)(Home);
